INSERT INTO `pages` VALUES (1,'about','About','2009-03-29','2009-03-29','<p>This is an application that I made in an evening to keep track of the games we played at work.</p>\n\n<h3>Version 2.0</h3>\n<p>&raquo; Conversion to CakePHP framework, replaced player graph.</p>\n\n<h3>Version 1.5.1</h3>\n<p>&raquo; Various bugfixes, formatting and layout fixes. Never launched, went straight to 2.0 instead.</p>\n\n<h3>Version 1.5</h3>\n<p>&raquo; Ranking algorithm installed.</p>\n\n<h3>Version 1.01</h3>\n<p>&raquo; Updated CSS and bug fixes. Games ordered by date played.</p>\n\n<h3>Version 1.0</h3>\n<p>&raquo; Initial Launch.</p>',1),(2,'contact','Contact','2009-03-29','2009-03-29','<p>To contact me, send an email to dave at zastica dot com. I\'ll get back to you as soon as I can.</p>',1);
