INSERT INTO `posts` VALUES (4,'Announcing Version 2.0','','2009-03-29 00:00:00','<p>Well, it\'s been awhile since I did any development on foos.zastica. I recently decided to try out the CakePHP framework, and instead of creating an entirely new application, I decided to convert an existing one that I had already created. I chose this app because it was pretty straight forward, and didn\'t have a lot of odd features.</p>\n\n<p>About halfway through conversion, however, I learned that it wasn\'t as simple as I had thought. There are a lot of interesting database queries that need to be done to get the aggregate account and player data, and Cake isn\'t optimized to handle that. This left me doing a lot of direct queries on the database. Although I\'m sure that part of that is my lack of CakePHP knowledge as well.</p>\n\n<p>So, as of today, foos.zastica is now in v2.0. Most of the changes are backend type stuff, but there\'s a few front-end changes as well. I\'ve widened the site, changed around some styles, and changed the player graph to use the flot jquery library. This allows IE users to see the graph. It used to be in SVG, but some users weren\'t able to see the graph so it had to go.</p>\n\n<p>One of the bigger updates is the RSS syndication of updates. Whenever the site updates, you can get notified in your RSS reader. To subscribe, go to <a href=\"http://foos.zastica.com/posts/rss/\">/posts/rss/</a></p>\n\n<p>I\'ve also got some more changes up my sleeve, but I\'ll wait on announcing those until I\'ve got a better idea when they will be ready.</p>',1),(1,'Score Tracker Launched','Version 1.0','2007-06-01 09:00:00','<p>I\'m announcing the launch of the Foosball League Score Tracker. It\'s super easy to use, just sign up, add your players, and begin to record games. Maybe if you\'re good enough, you can show up on the top players list. Easy as pie.</p>',1),(2,'Minor Updates','Version 1.01','2007-06-03 22:00:00','<p>Made some minor updates tonight, including a bugfix and some CSS updates. Games are now sorted by the date they were entered. Coming up soon: an updated rank algorithm.</p>',1),(3,'Updates: Rank Algorithm, CSS, and Stats','Version 1.5','2007-06-07 22:26:18','<p>I finished the first iteration of the ranking algorithm that this site uses. Rank is calculated based on how well you play in games and compared to how well you\'re expected to perform. The algorithm is subject to change at my whim, but it\'s as fair as I could make it. I\'d prefer to use an ELO or TrueSkill type algorithm, but it would take a lot more to develop. Sometime soon, perhaps.</p>',1),(11,'lowercase?','edit','2009-04-03 08:04:58','',0);
